      return siteTitle
        ? selfTitle
          ? (siteTitle + ' | ' + selfTitle)
          : siteTitle
        : selfTitle || 'VuePress'
    },
    $description () {
      return this.$page.frontmatter.description || this.$localeConfig.description || this.$site.description || ''
    },
    $lang () {
      return this.$page.frontmatter.lang || this.$localeConfig.lang || 'en-US'
